import React from 'react';

function Form() {
  return ( 
    <form>
      <label htmlFor="email">Email</label>
      <input type="text" name='email'/>
      <label htmlFor="password"></label>
      <input type="text" name='password' />
      <button>Submit</button>
    </form>
   );
}

export default Form;
